Mais como time futebolistico o maior é corinthians por que domina o femino é forte na base (nao atualmente mais vai bem) e tem historia no masculino.
Já como clube como um todo ai depende do esporte mais acho que é flamengo pois domina a ginastica,basquete e futebol.
